import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {
  Box,
  Card,
  CardContent,
  CardHeader,
  Typography,
  Button,
  IconButton,
} from '@material-ui/core';
import { Clock as ClockIcon, Star as StarIcon, Comment as CommentIcon } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
  card: {
    borderRadius: 15,
    backgroundColor: '#93e2bb',
    height: 350,
    width: 455,
  },
  cardContent: {
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-between',
    height: '100%',
  },
  cardImage: {
    width: 70,
    borderRadius: '50%',
    border: '3px solid #000',
  },
  username: {
    marginBottom: theme.spacing(2),
    display: 'flex',
    alignItems: 'center',
  },
  rating: {
    display: 'flex',
    alignItems: 'center',
    color: '#1B7B2C',
  },
  buttonGroup: {
    display: 'flex',
    justifyContent: 'flex-end',
    marginTop: theme.spacing(2),
  },
}));

export default function ECommerce() {
  const classes = useStyles();

  return (
    <Box height="100vh" bgcolor="#eee" display="flex" alignItems="center" justifyContent="center">
      <Card className={classes.card}>
        <CardContent className={classes.cardContent}>
          <div>
            <Typography variant="h6">Exquisite hand henna tattoo</Typography>
            <Box display="flex" alignItems="center" justifyContent="space-between" mb={3}>
              <Typography variant="body1" className="fw-bold">$90</Typography>
            </Box>
          </div>
          <div className={classes.username}>
            <img
              className={classes.cardImage}
              src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-profiles/avatar-2.webp"
              alt="Profile Avatar"
            />
            <div>
              <Box display="flex" alignItems="center">
                <Typography variant="body2" className="mb-0 me-2">
                  @sheisme
                </Typography>
                <Box className={classes.rating}>
                  {[1, 2, 3, 4, 5].map((index) => (
                    <StarIcon key={index} fontSize="small" />
                  ))}
                </Box>
              </Box>
              <div>
                <Button variant="outlined" color="dark" size="small">
                  + Follow
                </Button>
                <Button variant="outlined" color="dark" size="small" className="mx-1">
                  See profile
                </Button>
                <IconButton color="dark" size="small">
                  <CommentIcon />
                </IconButton>
              </div>
            </div>
          </div>
          <hr />
          <Typography variant="body2">52 comments</Typography>
          <div className={classes.buttonGroup}>
            <Button variant="contained" color="success" size="large">
              <ClockIcon fontSize="small" /> Book now
            </Button>
          </div>
        </CardContent>
      </Card>
    </Box>
  );
}
